import "../styles/About.css";
function About() {
  return (
    <div className="about">

      <div className="aboutBottom">
        <h2> Who we are </h2>

        <p>

COOKFOLIO is a tech company working to make everyday cooking fun because we believe that cooking is the key to a happier and healthier life for people, communities and the planet. The choices we make shape our world. And when we cook, the choices we make have an impact on ourselves, the people we cook for, the growers and producers we buy from and the wider environment. 

